    <script>
        function adjustWindIconSize() {
            var currentZoom = map.getZoom();
            // Define a base size and scale factor
            var baseSize = 20; // base pixel size at zoom level 10
            var scale = 1 + (currentZoom - 10) * 0.1;
            var newSize = baseSize * scale;
            // Select all FontAwesome wind icons in our custom markers
            var icons = document.getElementsByClassName("fa-wind");
            for (var i = 0; i < icons.length; i++) {
                icons[i].style.fontSize = newSize + "px";
            }
        }
        map.on("zoomend", adjustWindIconSize);
        // Call once on load to set the initial icon sizes
        adjustWindIconSize();
    </script>
